import React, { useState, useEffect, useRef } from "react";
import { useLanguage } from "../contexts/LanguageContext";
import { useTheme } from "../contexts/ThemeContext";
import { Typewriter } from "react-simple-typewriter";
import { motion, useAnimation, AnimatePresence, useSpring, useMotionValue } from "framer-motion";
import { languages } from "../languages.js";
import { FaGithub, FaLinkedin, FaTwitter } from 'react-icons/fa';

// Simple magnetic effect component that attracts to cursor
const MagneticText = ({ children, strength = 15 }) => {
  const textRef = useRef(null);
  const [isHovered, setIsHovered] = useState(false);

  // Motion values for x and y
  const x = useMotionValue(0);
  const y = useMotionValue(0);

  // Springs for smooth animation
  const springConfig = { damping: 15, stiffness: 150 };
  const springX = useSpring(x, springConfig);
  const springY = useSpring(y, springConfig);

  // Handle mouse move
  const handleMouseMove = (e) => {
    if (!textRef.current) return;

    const rect = textRef.current.getBoundingClientRect();
    const centerX = rect.left + rect.width / 2;
    const centerY = rect.top + rect.height / 2;

    // Calculate distance from cursor to center
    const distanceX = e.clientX - centerX;
    const distanceY = e.clientY - centerY;

    // Set motion values
    x.set(distanceX / 4 * strength / 20);
    y.set(distanceY / 4 * strength / 20);
  };

  // Reset position when mouse leaves
  const handleMouseLeave = () => {
    setIsHovered(false);
    x.set(0);
    y.set(0);
  };

  return (
    <motion.span
      ref={textRef}
      style={{ 
        x: springX, 
        y: springY,
        display: 'inline-block'
      }}
      onMouseEnter={() => setIsHovered(true)}
      onMouseMove={handleMouseMove}
      onMouseLeave={handleMouseLeave}
      className="relative"
    >
      {children}
      {isHovered && (
        <motion.span 
          className="absolute inset-0 -z-10 rounded-lg opacity-50"
          initial={{ opacity: 0, filter: 'blur(15px)' }} 
          animate={{ 
            opacity: 0.4, 
            filter: 'blur(20px)',
            scale: 1.2
          }}
          style={{
            background: 'linear-gradient(45deg, rgba(156,175,255,0.3), rgba(255,159,159,0.3))'
          }}
        />
      )}
    </motion.span>
  );
};

// Floating element with simplified motion
const FloatingElement = ({ children, delay = 0, duration = 2, yOffset = 10, className = "" }) => {
  return (
    <motion.div
      className={className}
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{
        opacity: { duration: 0.5, delay },
        y: { duration: 0.5, delay }
      }}
    >
      <motion.div
        animate={{ y: [0, -yOffset, 0] }}
        transition={{
          duration,
          repeat: Infinity,
          repeatType: "reverse",
          ease: "easeInOut",
          delay
        }}
      >
        {children}
      </motion.div>
    </motion.div>
  );
};

// Simple background icons component
const FloatingIcons = ({ theme }) => {
  const icons = [
    { icon: "✨", size: "text-2xl", x: "10%", y: "20%", duration: 3 },
    { icon: "💫", size: "text-3xl", x: "80%", y: "15%", duration: 4 },
    { icon: "⚡", size: "text-2xl", x: "70%", y: "70%", duration: 3.5 },
    { icon: "🌟", size: "text-4xl", x: "20%", y: "80%", duration: 5 },
    { icon: "💡", size: "text-3xl", x: "30%", y: "40%", duration: 4.5 },
    { icon: "⭐", size: "text-2xl", x: "85%", y: "60%", duration: 3.8 },
  ];

  return (
    <div className="absolute inset-0 overflow-hidden pointer-events-none">
      {icons.map((item, index) => (
        <motion.div
          key={index}
          className={`${item.size} absolute ${theme === 'dark' ? 'opacity-40' : 'opacity-20'}`}
          style={{
            left: item.x,
            top: item.y,
          }}
          animate={{
            y: [0, -20, 0],
            opacity: [0.2, 0.5, 0.2],
            scale: [1, 1.2, 1],
          }}
          transition={{
            duration: item.duration,
            repeat: Infinity,
            repeatType: "reverse",
            ease: "easeInOut",
          }}
        >
          {item.icon}
        </motion.div>
      ))}
    </div>
  );
};

const Home = () => {
  const { language } = useLanguage();
  const { theme } = useTheme();
  const [currentLanguage, setCurrentLanguage] = useState(null);

  useEffect(() => {
    // Dynamic import to avoid circular dependencies
    import('../languages.js').then(module => {
      setCurrentLanguage(module.languages[language]);
    });
  }, [language]);

  if (!currentLanguage) return null;

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.15
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.5
      }
    }
  };

  return (
    <div className="min-h-screen relative overflow-hidden">
      <motion.div
        className="container mx-auto px-4 sm:px-6 lg:px-8 py-16 md:py-24"
        initial="hidden"
        animate="visible"
        variants={containerVariants}
      >
        <div className="flex flex-col md:flex-row items-center justify-between">
          <motion.div variants={itemVariants} className="md:w-1/2 mb-8 md:mb-0">
            <MagneticText strength={25}>
              <h1 className="text-4xl md:text-6xl font-bold mb-4 bg-gradient-to-r from-rose-500 to-indigo-500 bg-clip-text text-transparent">
                {currentLanguage.home_title}
              </h1>
            </MagneticText>

            <motion.p
              variants={itemVariants}
              className="text-lg md:text-xl mb-6 max-w-lg leading-relaxed"
            >
              {currentLanguage.home_description}
            </motion.p>

            <motion.div
              variants={itemVariants}
              className="flex space-x-4"
            >
              <a 
                href="#contact" 
                className="px-6 py-3 rounded-full bg-gradient-to-r from-rose-500 to-indigo-500 text-white font-semibold hover:from-rose-600 hover:to-indigo-600 transition-all duration-300 shadow-lg hover:shadow-xl transform hover:-translate-y-1"
              >
                {currentLanguage.get_in_touch}
              </a>
              <a 
                href="#projects" 
                className={`px-6 py-3 rounded-full border-2 border-indigo-500 font-semibold hover:bg-indigo-500 hover:text-white transition-all duration-300 shadow-md hover:shadow-lg transform hover:-translate-y-1 ${
                  theme === 'light' ? 'text-indigo-700' : 'text-indigo-300'
                }`}
              >
                {currentLanguage.view_work}
              </a>
            </motion.div>

            <motion.div 
              variants={itemVariants}
              className="flex space-x-4 mt-8"
            >
              <MagneticText strength={15}>
                <a 
                  href="https://github.com/yourusername" 
                  target="_blank" 
                  rel="noopener noreferrer"
                  className="text-3xl hover:text-rose-500 transition-colors duration-300"
                >
                  <FaGithub />
                </a>
              </MagneticText>
              <MagneticText strength={15}>
                <a 
                  href="https://linkedin.com/in/yourusername" 
                  target="_blank" 
                  rel="noopener noreferrer"
                  className="text-3xl hover:text-blue-500 transition-colors duration-300"
                >
                  <FaLinkedin />
                </a>
              </MagneticText>
              <MagneticText strength={15}>
                <a 
                  href="https://twitter.com/yourusername" 
                  target="_blank" 
                  rel="noopener noreferrer"
                  className="text-3xl hover:text-sky-500 transition-colors duration-300"
                >
                  <FaTwitter />
                </a>
              </MagneticText>
            </motion.div>
          </motion.div>

          <motion.div 
            variants={itemVariants}
            className="md:w-1/2 flex justify-center"
          >
            <FloatingElement delay={0.3} yOffset={7} duration={3}>
              <div className="relative rounded-full overflow-hidden border-4 border-indigo-500 shadow-2xl">
                <img 
                  src="/logo192.png" 
                  alt="Profile" 
                  className="w-64 h-64 md:w-80 md:h-80 object-cover"
                />
                <div className="absolute inset-0 bg-gradient-to-tr from-rose-500/20 to-indigo-500/20"></div>
              </div>
            </FloatingElement>
          </motion.div>
        </div>
      </motion.div>

      {/* Floating Icons Background */}
      <div className="absolute inset-0 -z-10 overflow-hidden pointer-events-none">
        <FloatingIcons theme={theme} />
      </div>
    </div>
  );
};

export default Home;
